import React from "react";
import styled from "styled-components";

const AboutEC_Page = styled.div`
  height: 1299px;
  background-color: #f2f2f2;
`;

const AboutEcContainer = styled.div`
  max-width: 1280px;
  margin: 0 auto;
  padding-left: 40px;
  padding-right: 40px;
  box-sizing: border-box;
  display: flex;
  flex-direction: column;
  .AboutEcLeft {
    height: 197px;
    font-size: 32px;
    font-weight: bold;
  }
`;

function AboutEC() {
  return (
    <AboutEC_Page>
      <AboutEcContainer>
        <div className="AboutEcLeft">
          <span>AboutEC</span>
        </div>
        <div className="AboutEcContent">
          <div>Endless Creation~~~입니다</div>
          <div className="AboutEcVideo"></div>
          <div className="AboutEcnamehardtq">
            <div>1</div>
            <div>2</div>
            <div>3</div>
          </div>
        </div>
      </AboutEcContainer>
    </AboutEC_Page>
  );
}

export default AboutEC;
